css:
@-moz-document domain("caniuse.com") {
.feature-heading .unoff {
    color: #b1b1b1;
}
.feature-heading .wd {
    color: #f24d4d;
}
.feature-heading .cr {
    color: #b0dd6f;
}
.a,
.alt-p .p,
.alt-j .j,
.support-list:hover > ol > .a.selected--left,
.support-list:hover > ol > .a.selected--right {
    background-color: #D7A91F;
}
.support-tooltip.a {
    background: #D7A91F !important;
}
.accessible-colors 
.support-tooltip.a {
    background: #8090F9 !important;
}
.support-stats:hover h4,
.support-stats:hover span {
    background: #666;
}
.support-stats .support {
    color: #2ed745;
}
.support-stats .partial {
    color: #f7f73d;
}
.support-stats .total {
    color: white;
}
.support-list:hover > ol > .n,
.support-list:hover > ol > .p {
    background-color: #e52;
}
.support-list:hover > ol > .a {
    background-color: #eaba29;
}
.support-list:hover > ol > .y {
    background-color: #47d25a;
}

.feature-block,
.secondary-content,
.option-tag {
    background: #4b4b4b !important;
    color: white;
}
.option-tag__button {
    color: white;
    border: none;
}
.view-mode-button.selected,
.show-all-versions-button.selected,
.view-mode-button:hover,
.show-all-versions-button:hover {
    background-color: #DD8203;
}
.view-mode-button,
.show-all-versions-button,
.accessible-colors .view-mode-button,
.accessible-colors .show-all-versions-button {
    color: #ddd;
}
.news-item__date,
.browser-heading {
    color: white;
}
.feature-tab-container .feature-tab {
    background: #797979;
}
.feature-tab-container .feature-tab::after {
    border-left-color: #797979;
}
.feature-panel-container,
.feature-tab-container .feature-tab.active,
.feature-tab-container .feature-tab:hover {
    background: #5e5e5e;
}
.feature-tab-container .feature-tab.active::after,
.feature-tab-container .feature-tab:hover::after {
    border-left-color: #5e5e5e;
}
.feature-panel-container .num-note:hover {
    border-bottom: 1px solid #bbb;
}
.support-list:hover > .cell-filler {
    background-color: rgba(255, 255, 255, 0.06);
}

.home__index-strip > a:hover {
    background-color: #555;
}

body {
    background-image: url(data:image/png;base64,);
}

a,
.footer__list-item > a,
.external-link,
.home__list-item a,
.home__browser-note-btn {
    color: #def;
}
.footer__list-item > a:hover,
.external-link:hover,
.home__list-item a:hover,
.home__browser-note-btn:hover {
    color: #adf;
}
.footer__primary,
.ciu-footer,
.ciu-legend__item {
    color: rgba(255, 255, 255, 0.4);
}
}
